import React from 'react';
import { Grid, Image, Segment } from 'semantic-ui-react';
import MovieInfo from '../HeaderSegement/Explore/MovieInfo';
import vk from "../Images/vk.jpg"



const HeaderPart = () => {
    return (
        <React.Fragment>
            <Grid>
                <Grid.Row textAlign='right'>
                    <Grid.Column>
                        <Segment color='transparent' inverted>
                            <Image
                                src={vk}
                                as='a'
                                target='_blank'
                            />
                            <MovieInfo url="https://www.youtube.com/watch?v=3PK2tIyENVA&t=2s" />
                        </Segment>
                    </Grid.Column>
                </Grid.Row>
            </Grid>
        </React.Fragment>
    )
}

export default HeaderPart;
